package practice;

public class SwapTwoNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a =10;
		int b =30;
		int temp;
		System.out.println("Before Swapping numbers: "+ a + " " + b);
		temp =a;
		a =b;
		b =temp;
		System.out.println("After swapping numbers: "+ a +" "+b);
		
		

	}

}
